import React from 'react';

const Chats = () => {
  return (
    <div className='chats'>
      <div className='user-chat'>
        <img src='https://images.pexels.com/photos/39866/entrepreneur-startup-start-up-man-39866.jpeg?auto=compress&cs=tinysrgb&w=600'
         alt='chat-image'/>
         <div className='userChat-info'>
            <span className='name'>Vinay</span>
            <span>Latest chat info</span>
         </div>
      </div>
    </div>
  )
}

export default Chats;
